import React from 'react';

function ArticleList({ articles, onSelect }) {
  return (
    <div>
      <h2>Articles</h2>
      {articles.length === 0 && <p>No articles available.</p>}
      {articles.map(article => (
        <div key={article.id} style={{ marginBottom: 10, borderBottom: '1px solid #ddd', paddingBottom: 10 }}>
          <h3>{article.title}</h3>
          <p>{article.date}</p>
          <button onClick={() => onSelect(article)}>Analyze ESG</button>
        </div>
      ))}
    </div>
  );
}

export default ArticleList;
